import React, { Component } from 'react';
import FirstComponent, {SecondComponent} from './components/learning-examples/FirstComponents'
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      //JSX always must have a parent component.
      <div className="App">
        My Hello World
        <FirstComponent></FirstComponent>
        <SecondComponent></SecondComponent>
        <ThirdComponent></ThirdComponent>
        <FourthComponent></FourthComponent>
      </div>
    );
  }
}

//Class and function components always must begin in capital letter




function FourthComponent(){
  return(
    <div className="FourthComponent">
      I'm the fourth component bitch!
    </div>
  );
}



export default App;
